import React from "react";
import { Link } from "react-router-dom";
import { useHistory } from "react-router-dom";
import axios from "axios";
import "./Header.css";

const Header = () => {
  const history = useHistory();

  const handleLogout = async (event) => {
    event.preventDefault();
    try {
      await axios.post("http://localhost:8000/logout");
      console.log("User logged out");
      // Redirect to the home page after successful logout
      history.push("/");
    } catch (error) {
      console.error("Error logging out:", error);
      // Handle any errors that occur during the logout request
    }
  };

  return (
    <div className="header">
      <div className="heading">
        <h1 className="h1">Student Portal</h1>
      </div>
      <div className="header-links">
        <Link to="/CourseDetails" className="header-link">
          Course Details
        </Link>
        <Link to="/hostel" className="header-link">
          Hostel
        </Link>
        <Link to="/events" className="header-link">
          Events
        </Link>
        <Link to="/Post" className="header-link">
          Posts
        </Link>
        <Link to="/others" className="header-link">
          Others
        </Link>
        <Link to="/logout" className="header-link" onClick={handleLogout}>
          Logout
        </Link>
      </div>
    </div>
  );
};

export default Header;
